DROP TABLE IF EXISTS account
CREATE TABLE `account` (  `accountid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `money` int(10) unsigned default '0',  `pmoney` int(10) unsigned default '0',  `lmoney` int(10) unsigned default '0',  `score` int(10) unsigned default '50',  `level` int(10) unsigned default '0',  PRIMARY KEY  (`accountid`),  UNIQUE KEY `accountid` (`accountid`),  KEY `userid` (`userid`),  CONSTRAINT `account_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS admins
CREATE TABLE `admins` (  `name` char(16) NOT NULL,  `pwd` char(32) default NULL,  `rtime` datetime default NULL,  `ltime` datetime default NULL,  `countexp` int(10) unsigned default '0',  `countrechange` int(10) unsigned default '0',  `countuser` int(10) unsigned default '0',  `counturl` int(10) unsigned default '0',  PRIMARY KEY  (`name`),  UNIQUE KEY `name` (`name`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS alipay_trade
CREATE TABLE `alipay_trade` (  `out_trade_no` char(32) NOT NULL,  `subject` char(128) NOT NULL,  `body` char(254) default NULL,  `total_fee` int(10) unsigned NOT NULL,  `trade_status` int(10) unsigned default NULL,  `trade_no` char(64) NOT NULL,  `buyer_email` char(64) NOT NULL,  `other` char(32) default NULL,  PRIMARY KEY  (`out_trade_no`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS filter
CREATE TABLE `filter` (  `id` int(10) unsigned NOT NULL auto_increment,  `url` varchar(250) NOT NULL,  `reason` char(128) default NULL,  PRIMARY KEY  (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS flow
CREATE TABLE `flow` (  `cid` int(10) unsigned default NULL,  `hrs` char(128) default NULL) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS jackin_account
CREATE TABLE `jackin_account` (  `accountid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `money` int(10) unsigned default '0',  `pmoney` int(10) unsigned default '0',  `lmoney` int(10) unsigned default '0',  `score` int(10) unsigned default '50',  `level` int(10) unsigned default '0',  PRIMARY KEY  (`accountid`),  UNIQUE KEY `accountid` (`accountid`),  KEY `userid` (`userid`),  CONSTRAINT `jackin_account_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `jackin_users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_alipay_trade
CREATE TABLE `jackin_alipay_trade` (  `out_trade_no` char(32) NOT NULL,  `subject` char(128) NOT NULL,  `body` char(254) default NULL,  `total_fee` int(10) unsigned NOT NULL,  `trade_status` int(10) unsigned default NULL,  `trade_no` char(64) NOT NULL,  `buyer_email` char(64) NOT NULL,  `other` char(32) default NULL,  PRIMARY KEY  (`out_trade_no`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_filter
CREATE TABLE `jackin_filter` (  `id` int(10) unsigned NOT NULL auto_increment,  `url` varchar(250) NOT NULL,  `reason` char(128) default NULL,  PRIMARY KEY  (`id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_flow
CREATE TABLE `jackin_flow` (  `cid` int(10) unsigned default NULL,  `hrs` char(128) default NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_orders
CREATE TABLE `jackin_orders` (  `orderid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `urlid` int(10) unsigned default NULL,  `val` int(10) unsigned NOT NULL,  `otype` int(11) default NULL,  `otime` datetime default NULL,  `svcid` int(11) default NULL,  `pm` int(11) default '0',  `lm` int(11) default '0',  `bae` int(11) default NULL,  PRIMARY KEY  (`orderid`),  KEY `userid` (`userid`),  CONSTRAINT `jackin_orders_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `jackin_users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_sessions
CREATE TABLE `jackin_sessions` (  `id` char(32) NOT NULL,  `data` text,  `last_accessed` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,  PRIMARY KEY  (`id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_url
CREATE TABLE `jackin_url` (  `urlid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `url` varchar(250) NOT NULL,  `name` char(30) NOT NULL,  `urltype` smallint(6) NOT NULL default '1',  `furls` text,  `usefurl` smallint(6) default '0',  `turl` varchar(250) default '',  `useturl` smallint(6) default '0',  `usepop` smallint(6) default '0',  `rtime` datetime default NULL,  `ltime` datetime default NULL,  `free` smallint(6) default '1',  `clickother` int(10) unsigned default '0',  `clickself` int(10) unsigned default '0',  `tdclick` int(10) unsigned default '0',  `online` smallint(6) default '0',  PRIMARY KEY  (`urlid`),  KEY `userid` (`userid`),  CONSTRAINT `jackin_url_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `jackin_users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_url_ip
CREATE TABLE `jackin_url_ip` (  `urlid` int(10) unsigned NOT NULL,  `ip` char(16) default NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_url_odrs
CREATE TABLE `jackin_url_odrs` (  `odrid` int(10) unsigned default NULL,  `urlid` int(10) unsigned default NULL,  `status` smallint(6) NOT NULL,  `sday` int(10) unsigned NOT NULL,  `svcid` smallint(6) NOT NULL,  `dayprice` int(11) default NULL,  `btime` datetime default NULL,  `etime` datetime default NULL,  KEY `urlid` (`urlid`),  KEY `odrid` (`odrid`),  CONSTRAINT `jackin_url_odrs_ibfk_1` FOREIGN KEY (`urlid`) REFERENCES `jackin_url` (`urlid`),  CONSTRAINT `jackin_url_odrs_ibfk_2` FOREIGN KEY (`odrid`) REFERENCES `jackin_orders` (`orderid`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS jackin_users
CREATE TABLE `jackin_users` (  `userid` int(10) unsigned NOT NULL auto_increment,  `name` char(16) NOT NULL,  `pwd` char(32) default NULL,  `otime` datetime default NULL,  `ltime` datetime default NULL,  `rtime` datetime default NULL,  `email` char(128) NOT NULL,  `question` char(128) NOT NULL,  `answer` char(128) NOT NULL,  PRIMARY KEY  (`userid`),  UNIQUE KEY `userid` (`userid`),  UNIQUE KEY `name` (`name`)) ENGINE=InnoDB DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS orders
CREATE TABLE `orders` (  `orderid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `urlid` int(10) unsigned default NULL,  `val` int(10) unsigned NOT NULL,  `otype` int(11) default NULL,  `otime` datetime default NULL,  `svcid` int(11) default NULL,  `pm` int(11) default '0',  `lm` int(11) default '0',  `bae` int(11) default NULL,  PRIMARY KEY  (`orderid`),  KEY `userid` (`userid`),  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS tdlogin
CREATE TABLE `tdlogin` (  `userid` int(11) default NULL,  `ltime` datetime default NULL) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS url
CREATE TABLE `url` (  `urlid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `url` varchar(250) NOT NULL,  `name` char(30) NOT NULL,  `urltype` smallint(6) NOT NULL default '1',  `furls` text,  `usefurl` smallint(6) default '0',  `turl` varchar(250) default '',  `useturl` smallint(6) default '0',  `usepop` smallint(6) default '0',  `rtime` datetime default NULL,  `ltime` datetime default NULL,  `free` smallint(6) default '1',  `clickother` int(10) unsigned default '0',  `clickself` int(10) unsigned default '0',  `tdclick` int(10) unsigned default '0',  `online` smallint(6) default '0',  PRIMARY KEY  (`urlid`),  KEY `userid` (`userid`),  CONSTRAINT `url_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
DROP TABLE IF EXISTS url_ip
CREATE TABLE `url_ip` (  `urlid` int(10) unsigned NOT NULL,  `ip` char(16) default NULL) ENGINE=InnoDB DEFAULT CHARSET=latin1
